func NewYobit(userConfig map[string]interface{}) *Yobit {
	p := NewYobitCore()
	p.Init(userConfig)
	return &Yobit{
		YobitCore:     p,
		Core:          p,
		exchangeTyped: NewExchangeTyped(&p.Exchange),
	}
}
func NewYobitFromCore(core *YobitCore) *Yobit {
	return &Yobit{
		YobitCore:     core,
		Core:          core,
		exchangeTyped: NewExchangeTyped(&core.Exchange),
	}
}

